import React from 'react';
import Post from '../Post/Post';
import avatarka from '../image/down2.jpg';
import m from './MyPosts.module.css';

const MyPosts = () => {
  let mymsg = [
    { img: avatarka, ike: 'like', msg: 'barior axperner' },
    { img: avatarka, ike: 'like', msg: 'inchka chka' },
  ];
  let Ofmsg = mymsg.map((pst) => {
    return <Post img={pst.img} ike={pst.ike} />;
  });
  return (
    <div className={m.mypost}>
      <div>My posts</div>
      <form>
        <textarea rows='12px' cols='13px'></textarea>
        <button>add text</button>
      </form>
      <div>New Post</div>
      <div className='posts'>
        <Ofmsg />
      </div>
    </div>
  );
};

export default MyPosts;
